import React from "react";
import workoutbg from "../assets/workoutbg.png"

const Projects = (props) => {
  const { projects } = props;
  return (
    <div className="projects">
      <div className="row justify-content-center">
        <div className="col-md-6 carde">
          <div className="cardtop">
              <img src={workoutbg} className="cardimg" />

          </div>
          <div class="cardbody">          
            
            
              <h4>Home Workout App</h4>
              <p>An App to create and track a daily workout</p>               
                
        
          </div> 
        </div>
        <div className="col-md-6">
          <h4 id="projectHeader">Projects</h4>
        </div>
      </div>
    </div>
  );
};

export default Projects;
